import React from "react";
import './styles/App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import AddProduct from "./pages/AddProduct";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/addproduct">
                    <AddProduct/>
                </Route>
            </Routes>
        </BrowserRouter>
    );
}


export default App;


